function alert_info(x){
    if(entry_list[x].phone)
        alert(entry_list[x].ownername + '\n' + entry_list[x].email + '\n' + entry_list[x].phone);
    else
        alert(entry_list[x].ownername + '\n' + entry_list[x].email);
}

function add_entry(i){
    const entry_cont = document.createElement("article");
    const photo = document.createElement("img");
    const catname = document.createElement("h3");
    const type = document.createElement("section");
    const species = document.createElement("p");
    const breed = document.createElement("p");
    const fur = document.createElement("p");
    const traits = document.createElement("section");
    const height = document.createElement("p");
    const weight = document.createElement("p");
    const age = document.createElement("p");
    const description = document.createElement("p");
    const owner = document.createElement("button");

    photo.src = "data:image/png;base64," + img_list[i];
    catname.innerHTML = entry_list[i].catname;
    // Get the modal
    var modal = document.getElementById("myModal");

    // Get the image and insert it inside the modal - use its "alt" text as a caption
    var modalImg = document.getElementById("img01");
    var captionText = document.getElementById("caption");
    photo.onclick = function(){
        modal.style.display = "block";
        modalImg.src = this.src;
        captionText.innerHTML = catname.innerHTML;
    }

    // Get the <span> element that closes the modal
    var span = document.getElementsByClassName("close")[0];

    // When the user clicks on <span> (x), close the modal
    span.onclick = function() {
    modal.style.display = "none";
    }

    species.innerHTML = entry_list[i].species;
    breed.innerHTML = entry_list[i].breed;
    fur.innerHTML = entry_list[i].fur;
    type.appendChild(species);
    type.appendChild(breed);
    type.appendChild(fur);
    height.innerHTML = "Height: " + entry_list[i].height + " cm";
    weight.innerHTML = "Weight: " + entry_list[i].weight + " kg";
    const nrage = entry_list[i].age;
    switch(nrage){
        case 1: age.innerHTML = "Age: <1 year"; break;
        case 2: age.innerHTML = "Age: 1-3 years"; break;
        case 3: age.innerHTML = "Age: 4-6 years"; break;
        case 4: age.innerHTML = "Age: >6 years"; break;
        default: break;
    }
    traits.appendChild(height);
    traits.appendChild(weight);
    traits.appendChild(age);

    owner.innerHTML = "Get owner's contact info.";
    owner.addEventListener("click", function() {alert_info(i)}, false);
    if(entry_list[i].colour && entry_list[i].colour != "#000000")
        owner.style.backgroundColor = entry_list[i].colour;
    else
    {
        const r = Math.random() * 255;
        const g = Math.random() * 255;
        const b = Math.random() * 255;
        owner.style.backgroundColor = "rgb(" + r + "," + g + "," + b + ")";
    }

    entry_cont.appendChild(photo);
    entry_cont.appendChild(catname);
    entry_cont.appendChild(type);
    entry_cont.appendChild(traits);

    if(entry_list[i].description){
        description.setAttribute("id", "description");
        description.innerHTML = entry_list[i].description;
        entry_cont.appendChild(description);
    }

    entry_cont.appendChild(owner);
    document.getElementById("entrycontainer").appendChild(entry_cont);

    entry_cont.classList.add("entry");

}

function search_spec(x){
    if(document.getElementById("species_search").value == "All")
        return true;
    if(document.getElementById("species_search").value == x)
        return true;
    return false;
}

function search_breed(x){
    if(document.getElementById("breed_search").value == "All")
        return true;
    if(document.getElementById("breed_search").value == x)
        return true;
    return false;
}

function search_fur(x){
    if(document.getElementById("fur_search").value == "All")
        return true;
    if(document.getElementById("fur_search").value == x)
        return true;
    return false;
}

function search_age(x){
    if(document.getElementById("age_search").value == "All")
        return true;
    if(document.getElementById("age_search").value == "<1 year" && x == 1)
        return true;
    if(document.getElementById("age_search").value == "1-3 years" && x == 2)
        return true;
    if(document.getElementById("age_search").value == "4-6 years" && x == 3)
        return true;
    if(document.getElementById("age_search").value == ">6 years" && x == 4)
        return true;
    return false;
}

function search(){
    const entries = document.getElementsByClassName("entry");
    let N = entries.length;
    for(let i = 0; i < N; i++)
        entries[0].remove();
    for(let i = 0; i < entry_list.length; i++)
        if(search_spec(entry_list[i].species) && search_breed(entry_list[i].breed) && search_fur(entry_list[i].fur) && search_age(entry_list[i].age))
            add_entry(i);
}

window.onload = function(){
    nr = Number(localStorage.getItem("nr_entries"));
    for(let i = 0; i < nr; i++)
    {
        const entrydata = localStorage.getItem("entry" + (i+1));
        const imgdata = localStorage.getItem("entryphoto" + (i+1));
        entry_list.push(JSON.parse(entrydata));
        img_list.push(imgdata);
    }

    for(let i = 0; i < entry_list.length; i++)
        add_entry(i);

    const species_search = document.getElementById("species_search");
    const breed_search = document.getElementById("breed_search");
    const fur_search = document.getElementById("fur_search");
    const age_search = document.getElementById("age_search");
    species_search.addEventListener("change", search);
    breed_search.addEventListener("change", search);
    fur_search.addEventListener("change", search);
    age_search.addEventListener("change", search);

    var date = new Date();
    const htmldate = document.getElementById("date");
    var curday = date.getDate();
    var curminute = date.getMinutes();
    var curhour = date.getHours();
    var curmonth = (date.getMonth() + 1);
    var curyear = date.getFullYear();
    if(curminute < 10)
        curminute = "0" + curminute;
    if(curday < 10)
        curday = "0" + curday;
    if(curmonth < 10)
        curmonth = "0" + curmonth;
    htmldate.innerHTML = curhour + ":" + curminute + " " + curday + "/" + curmonth + "/" + curyear;
    var interval = setInterval(function() {
        date = new Date();
        curday = date.getDate();
        curminute = date.getMinutes();
        curhour = date.getHours();
        curmonth = (date.getMonth() + 1);
        curyear = date.getFullYear();
        if(curminute < 10)
            curminute = "0" + curminute;
        if(curday < 10)
            curday = "0" + curday;
        if(curmonth < 10)
            curmonth = "0" + curmonth;
        htmldate.innerHTML = curhour + ":" + curminute + " " + curday + "/" + curmonth + "/" + curyear;
    }, 60000);
}